const initialState = {
  type: null, //album, track, artist
  albumName: null,
  artistName: null,
  trackName: null,
  state: "idle",
};

export default function searchReducer(state = initialState, action) {
  switch (action.type) {
    default: {
      return state;
    }
  }
}
